import React from 'react';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
import { QUOTE_DETAIL_HEADER } from 'shared/constants/stringConstantsSelectors';
import { FlexboxContainer } from 'shared/styles/flexboxContainer';

export const QuoteDetail = props => {
    const classes = useStyles();

    const {
        symbol,
        name,
    } = props.record;

    let recordAttributes =[]; 

    let i = 0;
    for (const property in props.record) {
        recordAttributes.push(<Typography key={i} variant="body2" component="p">{ `${property}: ${props.record[property]}` }</Typography>);
        i++;
    };

    return (
        <div style={{padding: '1%', borderStyle: 'solid', borderWidth: '1px'}}>
            <FlexboxContainer>
                <h4 style={{padding: '0%'}}>{QUOTE_DETAIL_HEADER}</h4>
                <Button variant="contained" color="secondary" className={classes.button} onClick={e => props.onClose()}>X</Button>
                <div style={{width: '100%',backgroundColor: 'green', color: 'white', padding: '1%'}}>{name}</div>
                <Typography variant="h5" component="h2">{symbol}</Typography>
            {recordAttributes}
            </FlexboxContainer>

        </div>
    );

}

const useStyles = makeStyles(theme => ({
    button: {
      margin: theme.spacing(1),
    },
  }));
